import './FirstContainerStyle.css';
import BoxMovieComponent from './BoxMovieComponent'

function ComponentRow(props) {
  var movieRowData = props;
  return (

<div className="flex-container MovieRow">
    <BoxMovieComponent className="MovieTile"src={`https://image.tmdb.org/t/p/w500//${movieRowData[0].poster_path}`}  alt="test" title={`${movieRowData[0].original_title}`}  summary={`${movieRowData[0].overview}`}/>
    <BoxMovieComponent className="MovieTile" src={`https://image.tmdb.org/t/p/w500//${movieRowData[1].poster_path}`} alt="test" title={`${movieRowData[1].original_title}`}  summary={`${movieRowData[1].overview}`}/>
    <BoxMovieComponent className="MovieTile" src={`https://image.tmdb.org/t/p/w500//${movieRowData[2].poster_path}`} alt="test" title={`${movieRowData[2].original_title}`}  summary={`${movieRowData[2].overview}`}/>
    <BoxMovieComponent className="MovieTile" src={`https://image.tmdb.org/t/p/w500//${movieRowData[3].poster_path}`} alt="test" title={`${movieRowData[3].original_title}`}  summary={`${movieRowData[3].overview}`}/>

 </div>


  );
}

export default ComponentRow;
